// SPDX-License-Identifier: UNLICENSED
pragma solidity >=0.7.0;

// !!! LoC Counted !!!

contract ManualRockPaperScissors {

    uint8 public result; //P1-Wins: 1, P2-Wins: 2, Draw: 3
    address[] parties;
    bytes32 public commitment = 0;
    uint8 public rps2 = 0;

    constructor(address[] memory _parties){

        parties = _parties;

    }

    function commit(bytes32 _commitment) external {
        require(msg.sender == parties[0], "Wrong party to commit");
        require(commitment == 0, "Already committed");

        commitment = _commitment;
    }

    function move(uint8 _rps2) external {
        require(msg.sender == parties[1], "Wrong party to submit move");
        require(commitment != 0 && rps2 == 0, "Already submitted or no commitment");
        rps2 = _rps2 + 3;
    }

    function open(uint8 _rps1, uint nonce) external {
        require(msg.sender == parties[0], "Wrong party to open");
        require(rps2 != 0, "No move submitted");
        require(commitment == keccak256(abi.encode(_rps1, nonce)), "Wrong opening");

        if(rps2 % 3 == _rps1 % 3){
            result = 3;
        } else if (_rps1 % 3 == (rps2 + 1) % 3){
            result = 1;
        } else {
            result = 2;
        }
    }

    function getParties()  public view returns (address[] memory) {
    	return parties;
    } 
}
